import {Link} from 'react-router-dom';
const getUrl=(text)=>{
    const Url =(text.match(/(https?:\/\/[^\s]+)/g))
    return(
      <div className='bg-dark'>
      {Url}
      <Link to={Url}>Click here to open url</Link>
      </div>
    )
  }
  export default getUrl;
